import React from "react";

const Access = () => {
  return (
    <div className="mt-72 flex flex-col justify-center items-center text-center">
      <h1 className="text-[ADB3BE] contrast-0 font-semibold">
        WHY CHOOSE FIND MY TRAILS?
      </h1>
      <p className="text-[#050F4E] text-2xl mt-4">
        We helping patients access innovative clinical trials regardless <br />{" "}
        of demographics, location, or venue of care thus advocating <br />{" "}
        inclusion, equality and diversity.
      </p>
      <div className="flex mt-16 mr-[395px]">
        <div>
          <img src="images/Rectangle.png" alt="rectangle" />
        </div>
        <div className="flex flex-col">
          <h1>Promoting Inclusion and equality:</h1>
        </div>
      </div>
    </div>
  );
};

export default Access;
